import React from 'react';
//mport '../App.css';
//mport { Button } from './Button';
import { Button } from '@material-ui/core';
import './HeroSection.css';
import video from '../../assets/waves.mp4'
import { Link, useLocation } from 'react-router-dom';
import lucir from '../../assets/lucir.png';



function VideoBackground() {
    const image = lucir;
    return (
        <div>
            <div className='hero-container'>   
                <video src={video} autoPlay loop muted />
                <span id="welcomeTo">Presenting </span><img id="lucir" src={image} alt="Link to store" />
                <p id="intro">You have found the cleanest soap store on the internet. We pledge minimal processing, with maximum quality. We choose less processed ingredients, and aim to reduce energy waste in this world. We must all share the planet, and do so diligently: for a clean body, mind, soul, and Earth.</p>
                <Button component={Link} to="/shop" className='btn' variant="contained" color='mintgreen' style={{ maxWidth: '11    0px', maxHeight: '60px', minWidth: '110px', minHeight: '50px' }} >
                    Shop Now
                </Button>
            </div>

        </div>
    );
}

export default VideoBackground;
